import {Pokemon} from "../model/Pokemon";
import * as React from "react";

interface IProps {
    pokemonList: Pokemon[]
}

export function PokemonList(props: IProps) {

    return(
        <table>
            <tr>
                <th>
                    #
                </th>
                <th>
                    Name
                </th>
                <th>
                    Types
                </th>
                <th>
                    Weight
                </th>
            </tr>
            {props.pokemonList.map(pokemon => (
                <>
                <td>{pokemon.id}</td>
                <td>{pokemon.name}</td>
                <td>{pokemon.types.join(" ")}</td>
                <td>{pokemon.weight}</td>
                </>
            ))}
        </table>
    )

}
